  - - 1
    - Toyota C52 МКПП
    - "Ремонт коробки передач"
    - "<p>Выполнен ремонт гражданской механической коробки передач Toyota C52: разбор
      и дефектовка, мойка, сборка коробки передач с соблюдением всех заводских допусков
      и преднатягов. В обязательном порядке заменены все подшипники и кольца синхронизаторов."
    - 5
    - true
    - '2015-03-12 23:53:38.413309'
    - '2016-01-21 10:41:06.419336'
  - - 2
    - Mazda RX-7 FD3S
    - "Изготовление твинскролл коллектора"
    - "<p>Изготовлен и установлен кастом коллектор на роторный двигатель дрифтовой
      Mazda RX-7 FD3S. Коллектор твинскролльный под Garret GTX35 Twin Scroll, равнодлинный,
      с острым сводом. Для сварки коллектора использована нержавеющая труба и отводы
      марки AISI-321 (аналог 12х18н10т). Сварка выполнена с поддувом аргона внутрь
      ранеров коллектора для обеспечения формирования обратной стороны шва. По желанию
      заказчика сделаны выходы под один внешний вестгейт.\r\n<p>Под изменившееся расположение
      турбины переделаны линии подачи и слива масла, а также линии подачи и слива
      охлаждающей жидкости.\r\n<p>Коллектор эксплуатируется в 'боевых' режимах, держит
      EGT больше 1000°C."
    - 7
    - true
    - '2015-03-12 23:55:54.662544'
    - '2016-01-21 10:41:04.562427'
  - - 3
    - "Сварка в аргоне"
    - "Пепельница для автосервиса"
    - "<p>Изготовлена красивая и практичная пепельница из нержавеющей стали (AISI-321,
      полированная). Крепление на стену, быстроразъемное соединение на основе хомута
      V-Band для периодической очистки пепельницы. Лазерная гравировка лицевой стороны
      сигаретоприемника."
    - 4
    - true
    - '2015-03-13 00:15:31.676730'
    - '2016-01-21 10:41:07.448369'
  - - 4
    - Toyota MarkII 110
    - "Свап двигателя 2JZ-GTE"
    - "<p>Выполнен свап двигателя Toyota 2JZ-GTE в автомобиль Toyota MarkII (110 кузов).
      \r\n<p>Двигатель полность отдефектован и собран на кованой поршневой (JE Pistons
      8:1), ГБЦ собрана на Brian Crower, вкладыши ACL, шпильки ARP. Выполнены расточка
      блока цилиндров, полировка и балансировка коленчатого вала, правка седел клапанов
      и портинг ГБЦ, шлифовка всех плоскостей.\r\n<p>Установлена турбина Garret GTX3076R
      + 0,82 TiAL AR, выпускной коллектор by SOARA. Изготовлен кастом даунпайп и скример.
      Доработана трасса BLITZ Nur-R Spec. Вся обвязка мотора - кастом by Paladin Project.\r\n<p>Постоянная
      ссылка на проект на портале drive2.ru: <a href=\"http://www.drive2.ru/r/toyota/4035225266124016609\"
      target=\"_blank\">Toyota MarkII D Project</a>"
    - 3
    - true
    - '2015-03-13 00:18:14.812507'
    - '2016-01-21 10:41:08.454360'
  - - 5
    - TechRacing
    - "Наше оборудование"
    - "<p>Здесь Вы найдете фотографии нашего инструмента, который мы используем в
      повседневной работе. Некоторые из представленных позиций уникальны для индустрии
      автосервиса в России."
    - 2
    - true
    - '2015-03-13 00:23:49.748234'
    - '2016-01-21 10:41:09.578670'
  - - 6
    - Toyota Celica T23
    - "Покраска концентратом Candy"
    - "<p>Выполнена эксклюзивная покраска автомобиля Toyota Celica T23 GT концентратами
      Candy. В данном случае аэрографом прокрашены ребра автомобиля. Сочетание синего
      кенди и темно-синего базового цвета кузова автомобиля дают плавный переход света
      от ребер к плоскостям кузова."
    - 9
    - true
    - '2015-03-13 00:31:13.941693'
    - '2016-01-21 10:41:02.909828'
  - - 7
    - Lamborghini Gallardo
    - "Эксклюзивная покраска концентратами Candy"
    - " <p>Покрасили еще одну Lamborghini оранжевым концентратом кенди, на этот раз
      кабриолет Gallardo. Полная покраска кузова с разбором и проемами, технология
      покраски 'база-база-лак'. Сначала наносится подложка (в данном случае серебро),
      затем базовый цвет перекрывается концентрированным оранжевым пигментом в 5-7
      слоев, на заключительном этапе наносится лак."
    - 10
    - true
    - '2015-03-18 19:03:20.026245'
    - '2016-01-21 10:41:01.808325'
  - - 8
    - Mitsubishi Lancer Evo X
    - "Постройка двигателя 4B11T"
    - "<p>Полная постройка двигателя 4B11T на Mitsubishi Lancer Evo X. Установка мокрых
      гильз Darton, кованая поршневая, портинг ГБЦ. "
    - 6
    - true
    - '2015-05-12 23:18:34.024025'
    - '2016-01-21 10:41:05.349945'
  - - 9
    - Smart Roadster
    - "Эксклюзивная покраска в Candy"
    - " <p>Покрасили Smart Roadster в два цвета: черный (deep black) с оранжевым (orange
      candy). Было произведено полное снятие старого лакокрасочного покрытия в связи
      с нарушением технологии предыдущих покрасок. Колесные диски выкрашены в те же
      цвета, получился аккуратный и красивый автомобиль."
    - 8
    - true
    - '2015-06-16 06:59:33.348263'
    - '2016-01-21 10:41:03.811854'
